import wx
import base64
from enum import Enum
from io import BytesIO

from utils.config import Config

class PicID(Enum):
    Left_22 = 0
    Left_22_Mask = 1
    Right_33 = 2
    Right_33_Mask = 3

class PicResource:
    resource = {
        0: {"data": "", "size": wx.Size(116, 105)},
        1: {"data": "", "size": wx.Size(116, 105)},
        2: {"data": "", "size": wx.Size(108, 106)},
        3: {"data": "", "size": wx.Size(108, 106)}
    }

class Pic:
    @classmethod
    def get_pic_bitmap(cls, pic_id: PicID):
        entry = PicResource.resource.get(pic_id.value)

        decode_string = base64.b64decode(entry.get("data"))

        return wx.Image(BytesIO(decode_string))
    
    @staticmethod
    def get_scaled_size(size: wx.Size):
        if Config.Sys.dpi_scale_factor > 1.5:
            factor = 0.9

        elif Config.Sys.dpi_scale_factor > 1:
            factor = 1.2

        else:
            factor = 0.8

        return size.Scale(factor, factor)
